import './App.css';

import React, { Component } from 'react'
import Navbaar from './components/Navbaar';
import News from './components/News';

export default class App extends Component {
  static defaultProps ={
    country: 'in',
    pageSize: 10
  }
  render() {
    return (
      <>
     <Navbaar/>
     <News country={this.country} pageSize={this.pageSize}/>
     </>
    )
  }
}
